import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <img alt="" src="/images/book1.jpg" />
      <div class="info">
        <div class="title">Book 1</div>
        <div class="desc"><a href="books/4.html">An incredible book about incredible things that you should definitely read.</a></div>
      </div>
    </div>
  );
}

export default App;
